import React from 'react'
import PropTypes from 'prop-types'

function Button({text, color}) {
    var click = ()=>{
        console.log("clicked");
    };
    return (
        <button onClick = {click} style={{backgroundColor : color, width: 50, height :30}}>{text}</button> 
    )
}
Button.defaultProps = {
    color: "red"
}
Button.propTypes = {
    text: PropTypes.string.isRequired,
    color: PropTypes.string
}


export default Button
